package neural.reader;

import org.junit.jupiter.api.Test;

import neural.Machine;
import neural.NeuralMath;

public class ReadStringTest {

	@Test
	public void readStringTest() throws Exception {
		String strings[] = new String[] {
				"image/png;base64,",
				"image/png;base64,",
				"image/png;base64,",
				"image/png;base64," };

		ReadMachine rm = new ReadMachine();
		rm = (ReadMachine) Machine.load("bestRead");

		for (int i = 0; i < strings.length; i++) {
			String data = strings[i];

			ImageChain ic = MnistImageUtils.mnistTransform(data);
			ReadResult rr = rm.process(ic.mnist);
			rr.load(ic);

			// ImageUtils.writeImage(rr.getFloatImage(), "neural/testcase",
			// "mnist_n"+i+"_r"+rr.getResult());

			MnistImageUtils.writeImageChain(ic, "neural/testcase", "mnist_n" + i + "_r" + rr.getResult());

			System.out.println(i + ":" + rr.getResult() + "        "
					+ NeuralMath.stringVector(rm.getLastLayer().getActivations()));
		}
	}

}
